INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1001, "お！\nあそこに困ってそうな人発見！", 0, 2, "春咲 ひより", 1.4, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 1, 0, 1, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1002, "大切な人を\n守れるようになりたい…って", 0, 2, "草野 優衣", 1.4, "みんなみたいに\nわたしも強くならなきゃ", 0, 1, 0, 1, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1003, "キミに必要な集中力と感性が", 0, 2, "士条 怜", 1.4, "フェンシングを始めてみては？", 0, 1, 0, 1, 0, "少しは磨かれると思いますよ。");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1004, "今日はなにして遊ぶ？", 0, 2, "穂高 みそぎ", 1.5, "ねぇ、にいちゃん！", 0, 1, 0, 1, 0, "みそぎはねぇ、\nかくれんぼやりたい！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1006, "ねぇ…", 0, 2, "風宮 あかり", 1.4, "風宮あかりです", 0, 1, 0, 1, 0, "私といっしょに…\nいかない？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1007, "プリンたべたいのー", 0, 2, "出雲 宮子", 1.5, "出雲宮子なのー", 0, 1, 0, 1, 0, "食べ物の恨みは怖いのー");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1008, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 2, "虹村 雪", 1.4, "ボクは虹村雪。", 0, 1, 0, 1, 0, "いいよ。\n見られることは運命さ…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1009, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 2, "柊杏奈", 1.4, "フッ…聞いて後悔するがいい！", 0, 1, 0, 1, 0, "人呼んで「疾風の冥姫」!!");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1010, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 2, "姫宮 真歩", 1.5, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 1, 0, 1, 0, "ほんまおおきにやわ～♪");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1011, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 2, "衣之咲 璃乃", 1.4, "衣之咲璃乃です！", 0, 1, 0, 1, 0, "ここで会ったが\n100年目～！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1012, "ち、超能力って…\n何のことかな～？", 0, 2, "柏崎 初音", 1.4, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 1, 0, 1, 0, "…って、お願い！\n誰にも言わないでおいて～！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1016, "一応カリスマ読モJKやってまっす！", 0, 2, "美波 鈴奈", 1.4, "ちょす！\n美波鈴奈だよ～♪", 0, 1, 0, 1, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1017, "東京は遊園地みたいなところさー", 0, 2, "喜屋武 香織", 1.4, "はいたーい。\n喜屋武香織さー。", 0, 1, 0, 1, 0, "でも、沖縄もとってもいいとこさー");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1018, "先生って呼ばれるのは\nくすぐったいから", 0, 2, "支倉 伊緒", 1.4, "支倉伊緒です。", 0, 1, 0, 1, 0, "イオちゃんって呼んでね。");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1020, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 2, "茜 ミミ", 1.5, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 1, 0, 1, 0, "ミミをおいてかないでぇ～");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1021, "あの……\nふぇ……", 0, 2, "栗林 くるみ", 1.5, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 1, 0, 1, 0, "ふぇぇぇぇぇん……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1022, "こんな私に貴重な時間を\n割いていただき、", 0, 2, "風宮 より", 1.4, "風宮よりです。\nあああああ！", 0, 1, 0, 1, 0, "なんてありがとうございます！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1023, "おにいちゃんどこいくの？\nえ？", 0, 2, "北条 綾音", 1.5, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 1, 0, 1, 0, "私こっち行きたいー\nね、早く早くー");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1025, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 2, "天野 すずめ", 1.4, "わっ…わっ…私、\n天野すずめといいます！", 0, 1, 0, 1, 0, "これて何か違う…\nあああすみません！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1027, "あなたは…運命の……\n伴侶……", 0, 2, "倉石 恵理子", 1.4, "……クスクス…私は\n…倉石恵理子……", 0, 1, 0, 1, 0, "離しませんわ………\n絶対に…!!");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1028, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 2, "佐々木 咲恋", 1.4, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 1, 0, 1, 0, "…そうでしょ？？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1029, "ぇっと…\nキミ、私のこと知らないの?!", 0, 2, "桜井 望", 1.4, "桜井望だよ！\nよろしくねっ", 0, 1, 0, 1, 0, "あはは、\n私もまだまだだなぁ～");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1030, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 2, "ニノン・ジュベール", 1.4, "デケデケデンっ！", 0, 1, 0, 1, 0, "ショーグン、\nワタシと一緒に天下統一デース！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1031, "でもって私の隣にいるのが……\nえ、見えない？", 0, 2, "上喜 しのぶ", 1.4, "上喜しのぶです。\n手元のドクロが父です。", 0, 1, 0, 1, 0, "おかしいですね……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1033, "けんども\nそれには足りないモンが…", 0, 2, "野戸まひる", 1.5, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 1, 0, 1, 0, "そう、\nオラのボケに突っ込める相方が…！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1034, "ちょっと緊張しちゃって…", 0, 2, "綾瀬 ゆかり", 1.4, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 1, 0, 1, 0, "ちょ\nちょっと一杯飲んできます…！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1036, "知らない人とは話しちゃいけないので", 0, 2, "氷川 鏡華", 1.5, "氷川鏡華…です", 0, 1, 0, 1, 0, "これ以上お話しすることは…\nないです！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1038, "……あ、アラーム。", 0, 2, "柏崎 栞", 1.4, "柏崎…栞です。", 0, 1, 0, 1, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1040, "私、一人も友達がいなくて……", 0, 2, "双葉 碧", 1.4, "ふ、双葉碧です。", 0, 1, 0, 1, 0, "野に咲く花が、\n唯一の話相手です。");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1042, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 2, "三角 千歌", 1.4, "三角千歌です。", 0, 1, 0, 1, 0, "そう思っています。");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1043, "あぁ？\nお前のそいつの仲間か？", 0, 2, "安芸 真琴", 1.4, "安芸真琴だ。", 0, 1, 0, 1, 0, "う、疑ってすまなかったな…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1044, "生けとし生ける全ての者よ！", 0, 2, "イリヤ・オーンスタイン", 1.4, "わらわこそは夜を総べる者！", 0, 1, 0, 1, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1045, "ぐふふふふ……はっ！", 0, 2, "遠見 空花", 1.4, "そこで騎士は妖精を乱暴に……", 0, 1, 0, 1, 0, "ｌク、クウカに何かご用ですか!?");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1046, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 2, "宮坂たまき", 1.4, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 1, 0, 1, 0, "う～ん…\n猫ってホントに最高にゃ～♪");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1048, "それでは早速クエストに…", 0, 2, "大神 美冬", 1.4, "大神美冬よ！", 0, 1, 0, 1, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1049, "クエストもバトルも\n掃除も洗濯も", 0, 2, "星野静流", 1.4, "星野静流だよ！", 0, 1, 0, 1, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1050, "見ての通りの\nセクシー美少女で", 0, 2, "玉泉美咲", 1.5, "アタシは玉泉美咲。", 0, 1, 0, 1, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1052, "？？？？", 0, 2, "リマ", 1.4, "？？？", 0, 1, 0, 1, 0, "？？？？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1053, "菓子でつろうなどと\n稚拙な策を……", 0, 2, "モニカ・ヴァイスヴィント", 1.5, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, 1, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1058, "菓子でつろうなどと\n稚拙な策を……", 0, 2, "ペコリーヌ", 1.5, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, 1, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1059, "菓子でつろうなどと\n稚拙な策を……", 0, 2, "コッコロ", 1.5, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, 1, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, 1060, "菓子でつろうなどと\n稚拙な策を……", 0, 2, "キャル", 1.5, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, 1, 0, "そ、そこまでいうなら\nもらってやる");
